----------------------------
--- CREAZIONE VISTE
----------------------------

CREATE view SITATORT.V_ACCESSLOG (app, utente, datini)
AS 
select app, utente, datini
from SITATORT.accesslog where stato = 1
union
select app, utente, datfin from SITATORT.accesslog where stato = 1;

CREATE view SITATORT.V_ACCESSLOG_SEZ (app, datini, datfin)
AS
select distinct app, datini, (select min(datini) from SITATORT.v_accesslog al1 where al1.datini > al.datini and al.app=al1.app ) as datfin
from SITATORT.v_accesslog al
where exists(select 1 from SITATORT.v_accesslog al2 where al2.datini > al.datini and al.app=al2.app );

CREATE view SITATORT.V_ACCESSLOG_USR (cnt, utente, sysute, app, datini, datfin, minuti, stato)
AS
select cnt, utente, sysute, app, datini, datfin, round( (datfin - datini) * 1440, 0 ) as minuti, stato
from SITATORT.accesslog;

CREATE view SITATORT.V_ACCESSLOG_COUNT (app, datini, datfin, cnt, minuti)
AS
select vals.app, vals.datini, vals.datfin, count(*) as cnt,
round( (vals.datfin - vals.datini) * 1440, 0 ) as minuti
from SITATORT.v_accesslog_sez vals, SITATORT.accesslog al
where al.datini < vals.datfin and al.datfin > vals.datini
and vals.app =  al.app
group by vals.app, vals.datini, vals.datfin;

CREATE view SITATORT.V_DYNENT (ENTITA,CODAPP,MASCHERA,DYNENT_TYPE)
AS
SELECT ENTITA,CODAPP,MASCHERA,0 as DYNENT_TYPE from SITATORT.DYNENT_GC
UNION
SELECT DYNENT_NAME,DYNENT_APP,cast (null as varchar(2000)),DYNENT_TYPE from SITATORT.DYNENT;

CREATE view SITATORT.V_PROSP_IMPR_G_ (annimpr_imprtip, impr_codimp, impr_nomimp, impr_tipimp )
AS
select ai.imprtip as annimpr_imprtip, i.codimp as impr_codimp, i.nomimp as impr_nomimp, i.tipimp as impr_tipimp
from SITATORT.annimpr ai, SITATORT.impr i
where ( ( ai.imprcod=i.cfimp ) or ( ai.imprcod=i.pivimp ) ) and ( i.cfimp is not null or i.pivimp is not null)
group by ai.imprtip, i.codimp, i.nomimp, i.tipimp;




